import { Component } from "react";
import Profile from "./Profile/Profile";

import { HorizontalLogo } from "../../../shared/logo/Logos";

import "./Head.css";

class Head extends Component
{
    props:any = this.props

    render(){
        let {displaySenderInformation, receiverProfile, senderProfile} = this.props
        return (
            <div className="homepage-head">
                {
                    ((displaySenderInformation === false)?
                    (<div className = "logo-information"> <HorizontalLogo /> </div>):(null))    
                }
                <div className = "sender-information"><Profile userData = {senderProfile} /></div>
                {
                    (displaySenderInformation ===  true)?
                    <div className = "receiver-information"><Profile userData = {receiverProfile} /></div>: null
                }
            </div>
        )
    }
}

export default Head
